import React from 'react';

const CoffeeList = ({ coffeeData }) => {
  return (
    <div>
      <h2>Our Coffee Beans</h2>
      <ul className="coffee-list">
        {coffeeData.map((coffee, index) => (
          <li key={index} className="coffee-item">
            <img src={coffee.image_url} alt={coffee.name} />
            <h3>{coffee.name}</h3>
            <p>Price: ${coffee.price.toFixed(2)}</p>
            <p>Region: {coffee.region}</p>
            <p>Weight: {coffee.weight}g</p>
            <p>Description: {coffee.description}</p>
            {/* Tambahkan tombol untuk melihat detail lebih lanjut */}
            <button onClick={() => alert(coffee.description)}>View Details</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CoffeeList;
